  false,\n\t\"url\": null,\n\t\"notes\": \"This comma-separated value (.csv) table,
  \"Table1_GADP_NOSSmoothSheets.csv,\" is a derivative table of the information in
  shapefile \"GADP_NOSSeafloorCharacter.zip\" included in USGS data release \"Gulf
  of Alaska Digitization Project; Digital seafloor character data from NOS smooth
  shets\" (http://dx.doi.org/10.5066/F7CV4FT9). \"Table1_GADP_NOSSmoothSheets.csv\"
  lists the NOS smooth sheets included in the associated shapefile (N = 329, plus
  insets), the number of samples for each smooth sheet, the year of collection (1892
  to 2001), and the smooth sheet scale (from 1:2,000 to 1:600,000). Smooth sheets
  are available through the National Geophysics Data Centeru00e2u0080u0099s online
  data portal (NDGC, http://www.ngdc.noaa.gov).\",\n\t\"license_title\": null,\n\t\"extras\":
